pragma solidity ^0.4.22;

contract SimpleStrStore {
    string value;

    event NewValueSet(string indexed _value, address _sender);
    event NewValueSetAgain(string indexed _value, address _sender);

    function set(string memory _value) public {
        value = _value;
        emit NewValueSet(value, msg.sender);
    }

    function setAgain(string memory _value) public {
        value = _value;
        emit NewValueSetAgain(value, msg.sender);
    }

    function get() public view returns (string memory, address) {
        return (value, msg.sender);
    }
}
